Verenigde Staten
Actie
107 minuten

goed

met Vin Diesel, Paul Walker en John Ortiz

Brian O'Conner (Paul Walker) is nu een FBI agent en zit in een speciaal team die Braga, een drugs baron, probeert te pakken. 
Brian probeert binnen te komen door in het drivers-team van Braga te komen. Dominic Toretto (Vin Diesel) is nog steeds op de 
vlucht voor de politie, maar wil wraak op Braga en probeert ook in het drivers-team te komen. Dit gebeurt via een straatrace. 
Brian en Dominic zullen moeten samenwerken om Braga te pakken te krijgen.:
